Tracks:

   1. Kids In America - The Muffs
   2. Shake Some Action - Cracker
   3. The Ghost In You - Counting Crows
   4. Here (Squirmel Mix) - Luscious Jackson
   5. All The Young Dudes - World Party
   6. Fake Plastic Trees (Acoustic Version) - Radiohead
   7. Change - The Lightning Seeds
   8. Need You Around - Smoking Popes
   9. Mullet Head - Beastie Boys
  10. Where'd You Go? - Mighty Mighty Bosstones
  11. Rollin' With My Homies - Coolio
  12. Alright - Supergrass
  13. My Forgotten Favorite - Velocity Girl
  14. Supermodel - Jill Sobule


It's hard to argue with The Muffs' cover of Kim Wilde's &quot;Kids in America,&quot; and Counting Crows' live &quot;The Ghost in You,&quot; 

Supergrass' &quot;Alright,&quot; and an acoustic version of Radiohead's &quot;Fake Plastic Trees.&quot; A pair of all-time pop-rock pantheon 

tracks get covered here to cautious approval -- both Cracker and World Party hold their own on more subdued renditions of The 

Flaming Groovies &quot;Shake Some Action&quot; and Mott The Hoople's &quot;All the Young Dudes&quot; respectively. Jill Sobule closes with her 

wry, deadpan &quot;Supermodel.&quot; &quot;I didn't eat yesterday, and I'm not going to eat today, and I'm not going to eat 

tomorrow...'cause I'm gonna be a supermodel...&quot;

